import React from 'react';
import './TaskList.css';

import Task from '../Task';

const TaskList = ( { dealsData }) => {
  return (
    <ul className="todo-list">
      <Task />
      { dealsData }
      <Task />
    </ul>
  );
};

export default TaskList;
